var arrLeague = [8,'德国甲组联赛','德國甲組聯賽','German Bundesliga','2014-2015','#990099','league_match/images/20130119152241.jpg',34,34,'德甲','德甲','GER D1','　　09/10赛季德国足球甲级联赛共由18支球队组成，采取双循环赛制（每支球队分别以主、客场身份和其他球队交锋两次）。单场比赛积分计算方法是胜者得3分、负者得0分、平局则双方各得1分，赛季末按累计积分高低排名，同分则依次按照淨胜球、进球数的多少来决定名次。&nbsp;<br/>　　联赛前两名直接参加10/11赛季冠军联赛小组赛，第三名取得参加10/11赛季冠军联赛外围赛的资格，四、五名参加10/11赛季欧霸杯联赛（德国盃冠军也可以参加欧霸杯联赛，而如果德国盃冠军已经取得欧战资格，则其名额将让给德国盃亚军）。联赛排名最后2名的球队直接降到乙级联赛，而倒数第三名则与乙级联赛第三名进行主客场两回合的升降级附加赛。'];
